import React, { Component } from "react";
import { Row, Col } from "antd";
import { Input } from "antd";
import { Space, Button } from "antd";

import { UserOutlined } from "@ant-design/icons";
import "./form.css";
const { TextArea } = Input;

const onChange = (e) => {
  console.log(e);
};
export default class UserForm extends Component {
  render() {
    return (
      <div>
        <Row
          type="flex"
          justify="center"
          align="middle"
          style={{ minHeight: "100vh" }}
        >
          <Row gutter={[48, 48]}>
            <Col span={12}>
              <Input
                size="large"
                placeholder="First Name"
                prefix={<UserOutlined />}
              />
            </Col>
            <Col span={12}>
              {" "}
              <TextArea
                placeholder="Favourite Brands"
                allowClear
                onChange={onChange}
              />
            </Col>
            <Col span={12}>
              <Input
                size="large"
                placeholder="Last Name"
                prefix={<UserOutlined />}
              />
            </Col>
            <Col span={12}>
              {" "}
              <TextArea
                placeholder="Notes"
                allowClear
                onChange={onChange}
              />
            </Col>
            <Col span={12}>
              <Input
                size="large"
                placeholder="Email Address"
                prefix={<UserOutlined />}
              />
            </Col>
            <Col span={12}>
              
              <TextArea
                placeholder="textarea with clear icon"
                allowClear
                onChange={onChange}
              />
            </Col>
          </Row>
        </Row>
      </div>
    );
  }
}
